import { useParams } from 'react-router-dom';
import Footer from '../../components/footer/footer';
import Header from '../../components/header/header';
import Icons from '../../components/icons/icons';
import RatingStars from '../../components/rating-stars/rating-stars';
// import { Guitar, Guitars } from '../../types/guitar';
import { guitars } from '../../mocks/guitars';
import { convertTypeGuitarToText } from '../../utils';

function GuitarFull (): JSX.Element {
  const params = useParams();
  const guitarId = Number(params.id);

  const requiredGuitar = guitars.find((guitar) => guitar?.id === guitarId );

  if (requiredGuitar) {
    return (
      <div className="wrapper">
        <Icons/>
        <Header />
        <main className="page-content">
          <div className="container">
            <h1 className="page-content__title title title--bigger">{requiredGuitar.name}</h1>
            <ul className="breadcrumbs page-content__breadcrumbs">
              <li className="breadcrumbs__item"><a className="link" href="./main.html">Главная</a>
              </li>
              <li className="breadcrumbs__item"><a className="link" href="./main.html">Каталог</a>
              </li>
              <li className="breadcrumbs__item"><a className="link">{requiredGuitar.name}</a>
              </li>
            </ul>
            <div className="product-container">
              <img className="product-container__img" src={requiredGuitar.previewImg} width="90" height="235" alt={requiredGuitar.name} />
              <div className="product-container__info-wrapper">
                <h2 className="product-container__title title title--big title--uppercase">{requiredGuitar.name}</h2>
                <RatingStars
                  rating = {requiredGuitar.rating}
                />
                <div className="tabs"><a className="button button--medium tabs__button" href="#characteristics">Характеристики</a><a className="button button--black-border button--medium tabs__button" href="#description">Описание</a>
                  <div className="tabs__content" id="characteristics">
                    <table className="tabs__table">
                      <tr className="tabs__table-row">
                        <td className="tabs__title">Артикул:</td>
                        <td className="tabs__value">{requiredGuitar.vendorCode}</td>
                      </tr>
                      <tr className="tabs__table-row">
                        <td className="tabs__title">Тип:</td>
                        <td className="tabs__value">{convertTypeGuitarToText(requiredGuitar.type)}</td>
                      </tr>
                      <tr className="tabs__table-row">
                        <td className="tabs__title">Количество струн:</td>
                        <td className="tabs__value">{requiredGuitar.stringCount} струнная</td>
                      </tr>
                    </table>
                    <p className="tabs__product-description hidden">Гитара подходит как для старта обучения, так и для домашних занятий или использования в полевых условиях, например, в походах или для проведения уличных выступлений. Доступная стоимость, качество и надежная конструкция, а также приятный внешний вид, который сделает вас звездой вечеринки.</p>
                  </div>
                </div>
              </div>
            </div>
          </div>

        </main>

        <Footer/>
      </div>
    );
  } else {
    return (
      <>
      </>
    );
  }
}

export default GuitarFull;
